import React from 'react';
import {Row, Col, Container, Card, ListGroup, Button, Image} from 'react-bootstrap';
import './app.css';
import './custom.scss';

import MainSpace from"./components/mainspace.js";
import Sidebar from "./components/sidebar.js";

class XMContact extends React.Component {
  render (){
    
    return(
      <Col className="main-space">
              <Col className='main-header'>XM Studio | Contact
              </Col>
              <Col className='main-content'></Col>
          </Col>  
    );
  
}
}


export default XMContact;
